import React from "react";
import Card from 'react-bootstrap/Card';

const Business = (props) => {
    const handleClick = () => {
        window.location = 'asfa';
    }
    return (
        <Card style={{ width: '18rem' }} onClick={handleClick}>
            <Card.Img variant="top" src={props.business.imageSrc} />
            <Card.Body>
                <Card.Title>{props.business.name}</Card.Title>
                <Card.Text>
                    {props.business.address}
                    <br />
                    {props.business.city}, {props.business.state}, {props.business.zipCode}
                    <br />
                    {props.business.category}
                    <br />
                    Rating: {props.business.rating}, Reviews: {props.business.reviewCount}
                </Card.Text>
            </Card.Body>
        </Card>
    );
}

export default Business;
